INSERT INTO `email_templates` VALUES (1,'assignee notification','assignee_notification','send email to task assignee','<p>Hello,&nbsp;</p><p>You have been assigned a new task with task Id of $$task_id for $$case_type. &nbsp;Please take action to complete the task. &nbsp;</p><p>Thank you</p>',1,'2023-03-21 13:36:43',1,'2023-07-30 21:44:13','$$assignee_email','Do_Not_Reply@testing.com','New Task has been assigned to you',1),(2,'new case is created','new_case_submission_ack','send email when new case is created','<p>Hello,&nbsp;</p><p>This is to confirm you have successfully submit a case of $$case_type. &nbsp;The case is currently in $$case_status. &nbsp;</p><p>Thank you</p><p>&nbsp;</p>',1,'2023-03-21 13:36:43',1,'2023-07-30 21:51:44','$$requester_email','Do_Not_Reply@testing.com','a new case has been successfully created',1),(3,'case status changed','case_status_change_notification','send email when case status changed','',1,'2023-03-21 13:36:43',1,'2023-04-21 13:36:43',NULL,NULL,'Notification - Your case status has been changed',1),(4,'New Case','','Email communication for New Case','<p>Hello,</p><p>This message is to inform you that case number <strong>$$case_number</strong> has been created.</p><p>The current status of the case is: <strong>$$case_status</strong>.</p><p>Please contact our UAP Team if you have any questions.</p><p>&nbsp;</p><p>Thank you,</p><p>&nbsp;</p>',1,'2023-03-21 13:36:43',1,'2023-07-25 14:04:47','$$requester_email','$$system_email','Do not Reply- Case $$case_type has been created',2);
